import { Component } from '@angular/core';
import { FormBuilder, FormGroup, Validators } from '@angular/forms';
import { ServiceService } from '../services/service.service';
import { Journeys } from '../models/Journeys';
import { Flight } from '../models/Flight';
import Swal from 'sweetalert2';

@Component({
  selector: 'app-newshore',
  templateUrl: './newshore.component.html',
  styleUrls: ['./newshore.component.scss']
})
export class NewshoreComponent {
  formSearch: FormGroup;
  listJourneys!: Journeys[];
  listFlights!: Flight[];
  loading: boolean = false;
  isTrue: boolean = false;

  constructor(private fb: FormBuilder, private service: ServiceService) {
    this.formSearch = this.fb.group({
      Origin: ['', Validators.required],
      Destination: ['', Validators.required]
    });
  }

  searchJourneys(): void{
    this.loading = true;
    this.service.searchJourneys(this.formSearch.value.Origin, this.formSearch.value.Destination).subscribe((data) => {
      this.loading = false;
      console.log('Data: ', data)
      if (data.length === 0) {
        Swal.fire({
          icon: 'error',
          title: 'Oops...',
          text: 'La ruta no puede ser procesada!',
        });
      } else {
        this.listJourneys = data;
      }
    })
  }

  seeFlights(flights: Flight[]): void {
    this.loading = true;
    this.isTrue = true;
    this.listFlights = flights;
    this.loading = false;
  }
}
<h1>VUELOS</h1>
<div style="padding: 25px; background-color: beige;" >
  <form [formGroup]="formSearch" style="padding-top: 10px;" (ngSubmit)="searchJourneys()">
    <fieldset>
      <div style="display: inline-block; width: 60%; vertical-align: top;">
        <div class="form-group row">
          <label class="control-label col-md-2">Origen</label>
          <div class="col-md-6">
              <input type="text" class="form-control" formControlName="Origin" [maxlength]="3"
              onkeyup="this.value=this.value.toUpperCase();" onfocus="changeInput()">
          </div>
        </div>
        <div class="form-group row" style="padding-top: 10px;">
          <label class="control-label col-md-2">Destino</label>
          <div class="col-md-6">
              <input type="text" class="form-control" formControlName="Destination" [maxlength]="3"
              onkeyup="this.value=this.value.toUpperCase();">
          </div>
        </div>
      </div>
    </fieldset>
    <div class="form-group" style="padding-top: 10px;">
      <button class="btn btn-success float-right" [disabled]="formSearch.invalid"><i class="fas fa-save"></i>Consultar</button>
    </div>
  </form>

  <div class="row" style="padding-top: 15px;">
    <div class="spinner-border text-primary" role="status" *ngIf="loading">
      <span class="sr-only"></span>
    </div>
    <br>
    <br>
    <table class="table" *ngIf="!isTrue">
      <thead>
        <th>Origen</th>
        <th>Destino</th>
        <th>Precio</th>
        <th>Rutas</th>
    </thead>
    <tbody>
      <tr *ngFor="let journeys of listJourneys">
        <td>{{ journeys.journey.origin }}</td>
        <td>{{ journeys.journey.destination }}</td>
        <td>{{ journeys.journey.price }}</td>
        <td><button class="btn btn-warning btn-sm float-right" (click)="seeFlights(journeys.journey.flights)" title="Eliminar"><i class="fas fa-trash-alt"></i>Ver rutas</button></td>
      </tr>
    </tbody>
    </table>
    <br>
    <h3 *ngIf="isTrue">Rutas</h3>
    <br>
    <table class="table" *ngIf="isTrue">
      <thead>
        <th>Origen</th>
        <th>Destino</th>
        <th>Precio</th>
        <th>Transporte</th>
    </thead>
    <tbody>
      <tr *ngFor="let flight of listFlights">
        <td>{{ flight.origin }}</td>
        <td>{{ flight.destination }}</td>
        <td>{{ flight.price }}</td>
        <td>
          Transportista aéreo: {{ flight.transport.flightCarrier }}
          <br>
          Numero de Vuelo: {{ flight.transport.flightNumber }}
        </td>
      </tr>
    </tbody>
    </table>
  </div>
</div>
